import { React, lazy, Suspense } from "react";
import { BrowserRouter, Switch, Route, Routes } from "react-router-dom";
import PageLoading from "../components/PageLoading";

import {
  Basket,
  Category,
  Favorites,
  Home,
  Order,
  OrderDone,
  Product,
  Profile,
} from "../pages/index";

import ScrollIntoView from "./ScrollIntoView";

const PrivateRoute = lazy(() => import("./PrivateRoute"));
const PublicRoute = lazy(() => import("./PublicRoute"));
const App = () => {
  return (
    <BrowserRouter>
      <ScrollIntoView>
        <Suspense fallback={<PageLoading />}>
          <Switch>
            <PublicRoute restricted={true} component={Home} path="/" exact />
            <PublicRoute
              restricted={true}
              component={Home}
              path="/home"
              exact
            />
            <PublicRoute
              restricted={true}
              component={Product}
              path="/product/:id"
              exact
            />

            <PublicRoute
              restricted={true}
              component={Category}
              path="/category/:id"
              exact
            />
            <PublicRoute
              restricted={true}
              component={Basket}
              path="/basket"
              exact
            />
            <PublicRoute
              restricted={true}
              component={Order}
              path="/order"
              exact
            />
            <PublicRoute
              restricted={true}
              component={OrderDone}
              path="/orderdone"
              exact
            />
            <PublicRoute
              restricted={true}
              component={Favorites}
              path="/favorites"
              exact
            />
            <PublicRoute
              restricted={true}
              component={Profile}
              path="/profile"
              exact
            />
            {/* Global */}

            <PublicRoute component={Home} path="*" />
            {/* <Route path="*" component={Home} /> */}
          </Switch>
        </Suspense>
      </ScrollIntoView>
    </BrowserRouter>
  );
};

export default App;
